import Vue from 'vue'
import Vuex from 'vuex'
import axios from 'axios'

Vue.use(Vuex)

const API_URL = 'http://localhost:8000/api'

export default new Vuex.Store({
  state: {
    files: [],
    currentFile: null,
    processedData: [],
    loading: false,
    error: null,
    // Authentication state
    token: localStorage.getItem('token') || null,
    refreshToken: localStorage.getItem('refreshToken') || null,
    user: JSON.parse(localStorage.getItem('user')) || null,
    isAuthenticated: !!localStorage.getItem('token')
  },
  getters: {
    isAuthenticated: state => !!state.token,
    authHeader: state => state.token ? { Authorization: `Bearer ${state.token}` } : {},
    currentUser: state => state.user
  },
  mutations: {
    setFiles(state, files) {
      state.files = files
    },
    setCurrentFile(state, file) {
      state.currentFile = file
    },
    setProcessedData(state, data) {
      state.processedData = data
    },
    setLoading(state, loading) {
      state.loading = loading
    },
    setError(state, error) {
      state.error = error
    },
    // Authentication mutations
    setAuth(state, { token, refreshToken, user }) {
      state.token = token
      state.refreshToken = refreshToken
      state.user = user
      state.isAuthenticated = true

      // Store in localStorage
      localStorage.setItem('token', token)
      localStorage.setItem('refreshToken', refreshToken)
      localStorage.setItem('user', JSON.stringify(user))
    },
    clearAuth(state) {
      state.token = null
      state.refreshToken = null
      state.user = null
      state.isAuthenticated = false

      // Clear localStorage
      localStorage.removeItem('token')
      localStorage.removeItem('refreshToken')
      localStorage.removeItem('user')
    }
  },
  actions: {
    // Authentication actions
    async registerUser({ commit }, userData) {
      commit('setLoading', true)
      try {
        const response = await axios.post(`${API_URL}/auth/register/`, userData)
        commit('setAuth', {
          token: response.data.access,
          refreshToken: response.data.refresh,
          user: response.data.user
        })
        // Set default Authorization header for all requests
        axios.defaults.headers.common['Authorization'] = `Bearer ${response.data.access}`
        commit('setLoading', false)
        return response.data
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Registration failed')
        throw error
      }
    },

    async loginUser({ commit }, credentials) {
      commit('setLoading', true)
      try {
        const response = await axios.post(`${API_URL}/auth/login/`, credentials)
        commit('setAuth', {
          token: response.data.access,
          refreshToken: response.data.refresh,
          user: response.data.user
        })
        // Set default Authorization header for all requests
        axios.defaults.headers.common['Authorization'] = `Bearer ${response.data.access}`
        commit('setLoading', false)
        return response.data
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Login failed')
        throw error
      }
    },

    async refreshToken({ commit, state }) {
      if (!state.refreshToken) return Promise.reject('No refresh token available')

      try {
        const response = await axios.post(`${API_URL}/auth/refresh/`, {
          refresh: state.refreshToken
        })

        commit('setAuth', {
          token: response.data.access,
          refreshToken: state.refreshToken,
          user: state.user
        })

        // Update Authorization header
        axios.defaults.headers.common['Authorization'] = `Bearer ${response.data.access}`

        return response.data
      } catch (error) {
        commit('clearAuth')
        throw error
      }
    },

    logout({ commit }) {
      commit('clearAuth')
      delete axios.defaults.headers.common['Authorization']
    },

    // File management actions
    async fetchFiles({ commit, getters }) {
      commit('setLoading', true)
      try {
        const response = await axios.get(`${API_URL}/excel-files/`, {
          headers: getters.authHeader
        })
        commit('setFiles', response.data)
        commit('setLoading', false)
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Failed to fetch files')
      }
    },

    async fetchFile({ commit, getters }, fileId) {
      commit('setLoading', true)
      try {
        const response = await axios.get(`${API_URL}/excel-files/${fileId}/`, {
          headers: getters.authHeader
        })
        commit('setCurrentFile', response.data)
        commit('setLoading', false)
        return response.data
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Failed to fetch file details')
        throw error
      }
    },

    async uploadFile({ commit, getters }, { title, file }) {
      commit('setLoading', true)
      try {
        const formData = new FormData()
        formData.append('title', title)
        formData.append('file', file)

        const response = await axios.post(`${API_URL}/excel-files/`, formData, {
          headers: {
            ...getters.authHeader,
            'Content-Type': 'multipart/form-data'
          }
        })

        commit('setLoading', false)
        return response.data
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Failed to upload file')
        throw error
      }
    },

    async processFile({ commit, getters }, fileId) {
      commit('setLoading', true)
      try {
        const response = await axios.post(`${API_URL}/excel-files/${fileId}/process/`, {}, {
          headers: getters.authHeader
        })
        commit('setLoading', false)
        return response.data
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Failed to process file')
        throw error
      }
    },

    async fetchProcessedData({ commit, getters }, fileId) {
      commit('setLoading', true)
      try {
        const response = await axios.get(`${API_URL}/processed-data/by_file/?file_id=${fileId}`, {
          headers: getters.authHeader
        })
        commit('setProcessedData', response.data)
        commit('setLoading', false)
        return response.data
      } catch (error) {
        commit('setLoading', false)
        commit('setError', error.response?.data || 'Failed to fetch processed data')
        throw error
      }
    }
  }
})
